const styles = {
  header: {
    width: "100%",
    display: "flex",
    alignItems: "center",
    height: 550,
    padding: 20,
    marginLeft: 100,
  },

  containerImage: {
    width: "50%",
  },

  button: {
    border: "none",
    height: 50,
    width: 50,
    alignItems: "center",
    display: "flex",
    backgroundColor: "transparent",
  },
};

export default styles;
